import React from 'react';

const queueManagers = Array(6).fill({
  title: 'Loading...',
  status: 'Checking',
  ip: '--',
  queueManager: '--'
});

const LiveQueueStatus = () => {
  return (
    <div>
      <h2 className="text-2xl font-bold text-gray-900 mb-6">Live Queue Manager Status</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {queueManagers.map((queue, index) => (
          <div
            key={index}
            className="bg-white rounded-lg shadow-md border-l-4 border-green-500 p-6 animate-pulse"
          >
            <div className="flex justify-between items-start mb-4">
              <h3 className="font-semibold text-gray-900">{queue.title}</h3>
              <span className="px-3 py-1 bg-green-100 text-green-700 text-xs font-semibold rounded-full">
                {queue.status}
              </span>
            </div>
            <div className="space-y-2 text-sm text-gray-600">
              <p><span className="font-medium">IP:</span> {queue.ip}</p>
              <p><span className="font-medium">Queue Manager:</span> {queue.queueManager}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default LiveQueueStatus;
